// Dependencies
import axios from "axios";
import Cookies from "js-cookie";
import swal from "sweetalert2";
import jwt_decode from "jwt-decode";

// SideBar components
import {
	CDBSidebar,
	CDBSidebarContent,
	CDBSidebarFooter,
	CDBSidebarHeader,
	CDBSidebarMenu,
	CDBSidebarMenuItem,
} from "cdbreact";

export {
	axios,
	Cookies,
	swal,
	jwt_decode,
	CDBSidebar,
	CDBSidebarContent,
	CDBSidebarFooter,
	CDBSidebarHeader,
	CDBSidebarMenu,
	CDBSidebarMenuItem,
};
